import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import History from './pages/History';
import Home from './pages/Home';
import Practice from './pages/Practice';
import Interview from './pages/Interview';
import Footer from './components/Footer.jsx';

import './App.css';
import 'tailwindcss/tailwind.css';
<script src="https://kit.fontawesome.com/5e955d75d7.js" crossorigin="anonymous"></script>



function App() {
  const [ttsService, setTtsService] = useState('browser'); // 默认TTS服务

  return (
    <Router>
      <div className="App">
        <Navbar setTtsService={setTtsService} />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/practice" element={<Practice ttsService={ttsService} />} />
          <Route path="/interview" element={<Interview ttsService={ttsService} />} />
          <Route path="/history" element={<History />} />
        </Routes>
      </div>
      <Footer />
    </Router>
  );
}

export default App;
